import React from 'react';


export default props => {

    return(

    <div>
            <label for="passoInput"> Passo:</label>
        <input
            id="passoInput"
            type="number"
            value={this.state.step}
            onChange={(e) =>
                this.setState({ step: +e.target.value })
            }
        />
    </div>)
}
